import React from 'react'
import './styles/card.css'
import { Player } from "../";

import socialcard from '../img/drama/the-social-network/socialcard.jpg'
import revecard from '../img/drama/the-revenant/revecard.jpg'
import prestcard from '../img/drama/the-prestige/prestcard.jpg'

const card = [socialcard, revecard, prestcard]

export default function Card() {
    
    
    
    return (
        
                
                <div className ="card">
                    
                    <div className="cardImage">
                        {
                            card.map(img => <img key={img} src={img} />)
                        }
                    </div> 
                    

                        
                </div>    
            
            

        

        
    )
}
